import logo from './logo.svg';
import './App.css';
import CountDown from './Timercomponent'


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <CountDown minutes={0} seconds={2}/>
        </div>

        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
          таймер
        </p>
      </header>
    </div>
  );
}

export default App;
